import React, { useState } from 'react';
import { Layout } from '../components/layout/Layout';
import { mockFacilities } from '../utils/mockData';
import { Building, MapPin, User, TrendingUp, Search, Filter, ChevronRight } from 'lucide-react';
import { useNavigate } from 'react-router-dom';

export const Facilities: React.FC = () => {
  const navigate = useNavigate();
  const [searchTerm, setSearchTerm] = useState('');
  const [sortBy, setSortBy] = useState<'name' | 'esgScore' | 'completion'>('name');
  const [filterScore, setFilterScore] = useState<'all' | 'excellent' | 'good' | 'improvement'>('all');

  const filteredFacilities = mockFacilities
    .filter(facility => {
      const matchesSearch = facility.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
                          facility.location.toLowerCase().includes(searchTerm.toLowerCase()) ||
                          facility.manager.toLowerCase().includes(searchTerm.toLowerCase());

      const matchesFilter = filterScore === 'all' ||
                          (filterScore === 'excellent' && facility.esgScore >= 90) ||
                          (filterScore === 'good' && facility.esgScore >= 70 && facility.esgScore < 90) ||
                          (filterScore === 'improvement' && facility.esgScore < 70);

      return matchesSearch && matchesFilter;
    })
    .sort((a, b) => {
      switch (sortBy) {
        case 'esgScore':
          return b.esgScore - a.esgScore;
        case 'completion':
          return b.dataCompleteness - a.dataCompleteness;
        default:
          return a.name.localeCompare(b.name);
      }
    });

  const getScoreColor = (score: number) => {
    if (score >= 90) return 'bg-green-100 text-green-800 border-green-200';
    if (score >= 70) return 'bg-yellow-100 text-yellow-800 border-yellow-200';
    return 'bg-red-100 text-red-800 border-red-200';
  };

  const getCompletionColor = (completion: number) => {
    if (completion >= 90) return 'bg-green-500';
    if (completion >= 70) return 'bg-blue-500';
    if (completion >= 50) return 'bg-yellow-500';
    return 'bg-red-500';
  };

  return (
    <Layout>
      <div className="space-y-6">
        <div className="flex flex-col sm:flex-row sm:items-center sm:justify-between">
          <h1 className="text-3xl font-bold text-gray-900">Facilities Management</h1>
          <div className="mt-4 sm:mt-0 text-sm text-gray-500">
            {filteredFacilities.length} of {mockFacilities.length} facilities
          </div>
        </div>

        {/* Search and Filter Bar */}
        <div className="bg-white p-4 rounded-lg shadow-sm">
          <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
            <div className="relative">
              <Search className="absolute left-3 top-1/2 transform -translate-y-1/2 text-gray-400 w-5 h-5" />
              <input
                type="text"
                placeholder="Search facilities..."
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
                className="w-full pl-10 pr-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-green-500 focus:border-transparent"
              />
            </div>

            <div className="flex items-center space-x-2">
              <Filter className="text-gray-400 w-5 h-5" />
              <select
                value={filterScore}
                onChange={(e) => setFilterScore(e.target.value as any)}
                className="flex-1 px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-green-500 focus:border-transparent"
              >
                <option value="all">All Scores</option>
                <option value="excellent">Excellent (90+)</option>
                <option value="good">Good (70-89)</option>
                <option value="improvement">Needs Improvement (&lt;70)</option>
              </select>
            </div>

            <div className="flex items-center space-x-2">
              <span className="text-sm text-gray-600">Sort by:</span>
              <select
                value={sortBy}
                onChange={(e) => setSortBy(e.target.value as any)}
                className="flex-1 px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-green-500 focus:border-transparent"
              >
                <option value="name">Name</option>
                <option value="esgScore">ESG Score</option>
                <option value="completion">Completion</option>
              </select>
            </div>
          </div>
        </div>

        {/* Facilities Grid */}
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          {filteredFacilities.map((facility) => (
            <div
              key={facility.id}
              className="bg-white rounded-lg shadow-sm hover:shadow-md transition-shadow cursor-pointer"
              onClick={() => navigate(`/admin/facility/${facility.id}`)}
            >
              <div className="p-6">
                <div className="flex items-start justify-between mb-4">
                  <div className="flex items-center">
                    <Building className="w-10 h-10 text-gray-400 mr-3" />
                    <div>
                      <h3 className="text-lg font-semibold text-gray-900">{facility.name}</h3>
                      <div className="flex items-center text-sm text-gray-600 mt-1">
                        <MapPin className="w-4 h-4 mr-1" />
                        {facility.location}
                      </div>
                    </div>
                  </div>
                  <ChevronRight className="w-5 h-5 text-gray-400" />
                </div>

                <div className="space-y-3">
                  <div className="flex items-center justify-between">
                    <span className="text-sm text-gray-600">Manager</span>
                    <div className="flex items-center text-sm font-medium text-gray-900">
                      <User className="w-4 h-4 mr-1" />
                      {facility.manager}
                    </div>
                  </div>

                  <div className="flex items-center justify-between">
                    <span className="text-sm text-gray-600">ESG Score</span>
                    <div className={`px-3 py-1 rounded-full text-sm font-medium border ${getScoreColor(facility.esgScore)}`}>
                      <div className="flex items-center">
                        <TrendingUp className="w-4 h-4 mr-1" />
                        {facility.esgScore}
                      </div>
                    </div>
                  </div>

                  <div>
                    <div className="flex items-center justify-between text-sm mb-1">
                      <span className="text-gray-600">Data Completion</span>
                      <span className="font-medium text-gray-900">{facility.dataCompleteness}%</span>
                    </div>
                    <div className="w-full bg-gray-200 rounded-full h-2">
                      <div
                        className={`h-2 rounded-full transition-all ${getCompletionColor(facility.dataCompleteness)}`}
                        style={{ width: `${facility.dataCompleteness}%` }}
                      />
                    </div>
                  </div>
                </div>

                <div className="mt-4 pt-4 border-t border-gray-100">
                  <div className="flex items-center justify-between text-xs text-gray-500">
                    <span>Last updated</span>
                    <span>{new Date(facility.lastUpdated).toLocaleDateString()}</span>
                  </div>
                </div>
              </div>
            </div>
          ))}
        </div>

        {filteredFacilities.length === 0 && (
          <div className="text-center py-12">
            <Building className="w-12 h-12 text-gray-400 mx-auto mb-4" />
            <p className="text-gray-500">No facilities found matching your criteria.</p>
          </div>
        )}
      </div>
    </Layout>
  );
};
